import './home.css';
import fact2 from '../images/Fact-2.png'
import fact1 from '../images/Fact-1.png'
import fact3 from '../images/Fact-3.png'
import fact4 from '../images/Fact-4.jpg'
import fact5 from '../images/Fact-5.jpg'
import fact6 from '../images/Fact-6.jpg'
import fact7 from '../images/Fact-7.jpg'
import fact8 from '../images/Fact-8.jpg'
import fact9 from '../images/Fact-9.jpg'
import image from './27579.jpg'
import back from "./back.png";
import React, { useRef, useState } from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
} from "react-router-dom";
import Text from '../text'
import Section from '../Section';

import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/effect-coverflow';
import 'swiper/css/pagination';
import Nav from '../Nav';
import './style.css';

import { EffectCoverflow, Pagination } from 'swiper/modules';



function Home() {
  
  return (
    <><Nav />
    <>
    <div
      className="hero min-h-screen bg-base-200"
      style={{
        backgroundImage: `url(${back})`,
        backgroundSize: 'cover', // Ensures the background image covers the entire container
        backgroundPosition: 'center', // Centers the background image
        backgroundRepeat: 'no-repeat', // Prevents the background image from repeating
      }}
    >
      
    </div>
    

<>
          <Swiper
            effect={'coverflow'}
            grabCursor={true}
            centeredSlides={true}
            slidesPerView={'auto'}
            coverflowEffect={{
              rotate: 50,
              stretch: 0,
              depth: 100,
              modifier: 1,
              slideShadows: true,
            }}
            pagination={true}
            modules={[EffectCoverflow, Pagination]}
            className="mySwiper"
          >
            <SwiperSlide>
              <img src={fact9} />
            </SwiperSlide>
            <SwiperSlide>
              <img src={fact1} />
            </SwiperSlide>
            <SwiperSlide>
              <img src={fact8} />
            </SwiperSlide>
            <SwiperSlide>
              <img src={fact3} />
            </SwiperSlide>
            <SwiperSlide>
              <img src={fact5} />
            </SwiperSlide>
            <SwiperSlide>
              <img src={fact4} />
            </SwiperSlide>
            <SwiperSlide>
              <img src={fact6} />
            </SwiperSlide>
            <SwiperSlide>
              <img src={fact2} />
            </SwiperSlide>
            <SwiperSlide>
              <img src={fact7} />
            </SwiperSlide>
          </Swiper>

          
          <Text></Text>
          <Section></Section>
        </></></>
        
        

      
  );
}

export default Home;
